import './App.css';
import Categories from './components/categories';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>QuizKy</h1>
        <h3>Life is not a multiple choice test, it's an open-book essay exam.</h3>
        </header>
        <Categories name="Coding"></Categories>

        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>

    </div>
  );
}

export default App;
